      .not-supported-browser {

      .download-button {
        position: absolute;
        display: block;
        left: 50%;

        top: 50%;
        width: 32%;

        background-size: 100% auto;
        background-position-y: bottom;
        background-repeat: no-repeat;
        text-indent: -9999px;
      }
      .download-button::after {
        position: absolute;
        content: '';

        width: 100%;
        height: 100%;
        left: 0;
        top: 0;
        background-size: 100% auto;
        background-position-y: bottom;
        background-repeat: no-repeat;

      }
